#build url to get data for date offset and airport code
def buildurl( int , code ):
   enddate = now + dt.RelativeDateTime(months=-int*chunks)
   startdate = now + dt.RelativeDateTime(months=-int*chunks-chunks)
   url = 'http://www.wunderground.com/history/airport/' + code + '/' + str(startdate.year) + '/' + str(startdate.month)  + '/' + str(startdate.day + 1) + '/CustomHistory.html?dayend=' + str(enddate.day) + '&monthend=' + str(enddate.month) + '&yearend=' + str(enddate.year) + '&req_city=&req_state=&req_statename=&reqdb.zip=&reqdb.magic=&reqdb.wmo=&format=1'
   return url

#function to keep calling url until we get a result
def openurl( url ):
    while True:
        try:
            response = urllib2.urlopen(url)
            return response
        except:
            continue

